import React from 'react';
import classes from '../scss/Jade.module.scss'
import Layout from "../containers/Layout/Layout";
const Jade = () => {
    return (
        <Layout>
            <div className={classes.Jade}>
                asda
            </div>
        </Layout>
    );
};

export default Jade;
